    false,nt"url": null,nt"notes": "Lake Umbagog is a newly established Refuge
    (in 1993) with an increasing visitation. Current visitation numbers are around 55,000
    visits/year. Though limited visitor services are currently offered, additional services
    will be proposed in the CCP. The purpose of this survey is to assess interested
    publicsu2019 and stakeholdersu2019 satisfaction with existing visitor conditions
    and experiences on the Refuge and the preferences for proposed changes to the Refuge
    affecting visitation. An additional purpose is to gauge customersu2019 understanding
    and knowledge regarding the Refuge so that future communications with stakeholders
